        replaceValue(3110, 3115, form5z.format(0)); // WSS-IDX-FLD-HST
        replaceValue(3115, 3120, form5z.format(0)); // WSS-IDX-FLD-SRV
        replaceValue(3120, 4020, 0); // WSS-GLS-LEN-HST
        replaceValue(4020, 4920, 0); // WSS-GLS-FLD-SRV
        replaceValue(4920, 4925, form5z.format(0)); // WSS-TOT-FLD-HST
        replaceValue(4925, 4930, form5z.format(0)); // WSS-TOT-FLD-SRV
        replaceValue(6941, 6942, "N"); // WSS-IND-ERR
        replaceValue(6942, 6947, form5z.format(0)); // WSS-IDX-SRV

        for (int i = 0; i < 80; i++) {
            wssSrvVari[i] = new WssSrvVari(i);
        }
